import React, {useState} from 'react'

function Otp() {

    const [phoneNumber, setPhoneNumber] = useState();
    const [otp, setOtp] = useState();

    const handleFormSubmit = () =>{
        e.preventDefault();
    }

    const handleOtpSubmit = () =>{
        e.preventDefault();
    }
  return (
    <div>
        <h2>login</h2>
      <form action="" onSubmit={handleFormSubmit}>
        <label htmlFor="phoneNumber" value = {phoneNumber} onChange= {(e)=>{setPhoneNumber(e.target.value)}}> Enter Your Phone Number</label>
        <input type="number" />
        <button type = "submit">Send otp</button>
      </form>

      <form action="" onSubmit={handleOtpSubmit}>
        <label htmlFor="phoneNumber" value = {otp} onChange= {(e)=>{setOtp(e.target.value)}}> Enter Your Phone Number</label>
        <input type="number" />
        <button type = "submit">Verify</button>
      </form>
    </div>
  )
}

export default Otp
